import React, { Component } from 'react'
import { FaInstagram, FaMailBulk, FaLinkedinIn, FaTwitter} from "react-icons/fa"

class Team extends Component {
    constructor(props) {
        super(props)
        this.state = {
            highlight: this.props.highlight
        }
    }
    render() {
        return (

            <div className='row'>
                <h3 className='orange-text'>Time</h3>
                <h6>Conheca nosso time</h6>
                <br></br>
                {process.env.REACT_APP_TEAM.split('|').map(t =>
                    <div className='col s4'>
                        <div className='card-panel grey lighten-5'>
                            <img src={require("../../../static/imgs/profile.jpeg")} alt="" class="circle responsive-img"/>
                            <h5>{t.split(',')[0]}</h5>
                            <h6>{t.split(',')[1]}</h6>
                            <p>{t.split(',')[2]}</p>
                            <FaInstagram/>
                            <FaMailBulk/>
                            <FaLinkedinIn/>
                            <FaTwitter/>
                        </div>
                    </div>
                )}
            </div>
        )
    }
}

export default Team
